import { Home } from "./pages";
import { Switch, Route } from "react-router";
// import { ReactComponent as Logo } from "./assets/images/cookie.svg";

function App() {
  return (
    <Switch>
      <Route path="/" exact component={Home} />
      <Route />
    </Switch>
  );
}

export default App;
